import React from "react";

function Menu({products}) {
    return (
        <div className="menu">
            <h1>Menu</h1>
            {products.map(product =>
                <ul key={product.id}>
                    <li>{product.name}</li>
                    <li>Category: {product.category}</li>
                    <li>Price: {product.price}</li>
                </ul>
            )}
        </div>
    )
}

export default Menu
